INSERT INTO `wp_posts` VALUES (1,1,'2018-01-11 16:07:21','2018-01-11 15:07:21','Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous !','Bonjour tout le monde !','','trash','open','open','','bonjour-tout-le-monde__trashed','','','2018-01-20 22:17:25','2018-01-20 21:17:25','',0,'http://www.star.com/?p=1',0,'post','',1),(2,1,'2018-01-11 16:07:21','2018-01-11 15:07:21','Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\n\n<blockquote>Bonjour ! Je suis un mécanicien qui aspire à devenir un acteur, et ceci est mon blog. J’habite à Bordeaux, j’ai un super chien qui s’appelle Russell, et j’aime la vodka-ananas (ainsi que perdre mon temps à regarder la pluie tomber).</blockquote>\n\n...ou bien quelque chose comme cela :\n\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis cette année. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\n\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href=\"http://www.star.com/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !','Page d’exemple','','trash','closed','open','','page-d-exemple__trashed','','','2018-01-24 10:52:25','2018-01-24 09:52:25','',0,'http://www.star.com/?page_id=2',0,'page','',0),(32,1,'2018-01-16 12:42:56','0000-00-00 00:00:00',' ','','','draft','closed','closed','','','','','2018-01-16