INSERT INTO `wp_wpbooklist_jre_book_quotes` VALUES (1,'ui','\"You never really understand a person until you consider things from his point of view… until you climb inside of his skin and walk around in it.\" - Harper Lee, To Kill a Mockingbird'),(2,'ui','\"I assign myself no rank or any limit, and such an attitude is very much against the trend of the times. But my world has become one of infinite possibilities.\" - Ralph Ellison, Invisible Man'),(3,'ui','\"You will become way less concerned with what other people think of you when you realize how seldom they do.\" - David Foster Wallace, Infinite Jest'),(4,'book','\"We accept the love we think we deserve.\" - Stephen Chbosky, The Perks of Being a Wallflower'),(5,'ui','\"Differences of habit and language are nothing at all if our aims are identical and our hearts are open.\" - J.K. Rowling, Harry Potter and the Goblet of Fire'),(6,'ui','\"It is only with the heart that one can see rightly... what is essential is invisible to the eye.\" - Antoine de Saint-Exupéry, The Little Prince'),(7,'ui','\"I won’t tell you what to believe, Eragon. It is far better to be taught to think critically and then be allowed to make your own decisions than to have someone else’s notions thrust upon you.\" - Christopher Paolini, Eldest'),(8,'book','\"Do not go gentle into that good night. Rage, rage against the dying of the light\" - Dylan Thomas'),(9,'ui','\"I wished to know the meaning of things. I am the meaning. I wished to find a warrant for being. I need no warrant for being, and no word of sanction upon my being. I am the warrant and the sanction.\" - Ayn Rand, Anthem'),(10,'ui','\"Be good, be young, be true! Evil is nothing but vanity, let us have the pride of good, and above all let us never despair.\" - Alexandre Dumas, fils, The Lady of the Camellias'),(11,'ui','\"Drive away and try to keep smiling. Get a little rock and roll on the radio and go toward all the life there is with all the courage you can find and all the belief you can muster. Be true, be brave, stand. All the rest is darkness.\" - Stephen King, IT'),(12,'ui','\"‘Why did you do all this for me?’ he asked. ‘I don’t deserve it. I’ve never done anything for you.’ ‘You have been my friend,’ replied Charlotte. ‘That in itself is a tremendous thing.’\" - E.B. White, Charlotte’s Web'),(13,'ui','\"The loneliest moment in someone’s life is when they are watching their whole world fall apart, and all they can do is stare blankly.\" - F. Scott Fitzgerald, The Great Gatsby'),(14,'ui','\"Sometimes the Bible in the hand of one man is worse than a whisky bottle in the hand of another.\" - Harper Lee, To Kill a Mockingbird'),(15,'ui','\"People are capable, at any time in their lives, of doing what they dream of.\" - Paulo Coelho, The Alchemist'),(16,'ui','“I am no bird, and no net ensnares me: I am a free human being with an independent will.\" - Charlotte Brontë, Jane Eyre'),(17,'ui','\"It does not do to dwell on dreams and forget to live.\" - J.K. Rowling, Harry Potter and the Sorcerer\\\'s Stone'),(18,'ui','\"Many that live deserve death. And some that die deserve life. Can you give it to them? Then do not be too eager to deal out death in judgement. For even the very wise cannot see all ends.\" - J.R.R. Tolkien, The Fellowship of the Ring'),(19,'ui','“‘Are you ready?’ Klaus asked finally. ‘No,’ Sunny answered. ‘Me neither,’ Violet said, ‘but if we wait until we’re ready we’ll be waiting for the rest of our lives, Let’s go.’\" - Daniel Handler, The Ersatz Elevator'),(20,'ui','\"And so we beat on, boats against the current, borne back ceaselessly into the past.\" - F. Scott Fitzgerald, The Great Gatsby'),(21,'ui','\"I took a deep breath and listened to the old brag of my heart: I am, I am, I am.\" - Sylvia Plath, The Bell Jar'),(22,'book','\"A room without books is like a body without a soul.\" - Marcus Tullius Cicero'),(23,'ui','\"The person, be it gentleman or lady, who has not pleasure in a good novel, must be intolerably stupid.\" - Jane Austen'),(24,'book','\"Good friends, good books, and a sleepy conscience: this is the ideal life.\" - Mark Twain'),(25,'ui','\"Fairy tales are more than true: not because they tell us that dragons exist, but because they tell us that dragons can be beaten.\" - Neil Gaiman, Coraline'),(26,'ui','\"Sometimes, you read a book and it fills you with this weird evangelical zeal, and you become convinced that the shattered world will never be put back together unless and until all living humans read the book.\" - John Green, The Fault in Our Stars'),(27,'book','\"Never trust anyone who has not brought a book with them.\" - Lemony Snicket, Horseradish'),(28,'ui','\"If you only read the books that everyone else is reading, you can only think what everyone else is thinking.\" - Haruki Murakami, Norwegian Wood'),(29,'book','\"You can never get a cup of tea large enough or a book long enough to suit me.\" - C.S. Lewis'),(30,'book','\"There is no friend as loyal as a book.\" - Ernest Hemingway'),(31,'book','\"′Classic′... a book which people praise and don\\\'t read.\" - Mark Twain'),(32,'ui','\"... a mind needs books as a sword needs a whetstone, if it is to keep its edge.\" - George R.R. Martin, A Game of Thrones'),(33,'book','\"My Best Friend is a person who will give me a book I have not read.\" - Abraham Lincoln'),(34,'ui','\"When I was about eight, I decided that the most wonderful thing, next to a human being, was a book.\" - Margaret Walker'),(35,'ui','\"Still round the corner there may wait / A new road or a secret gate / And though I oft have passed them by / A day will come at last when I / Shall take the hidden paths that run / West of the Moon, East of the Sun.\" - J.R.R. Tolkien'),(36,'ui','\"Books serve to show a man that those original thoughts of his aren\\\'t very new after all.\" - Abraham Lincoln'),(37,'book','\"Books are no more threatened by Kindle than stairs by elevators.\" - Stephen Fry'),(38,'book','\"There is some good in this world, and it’s worth fighting for.\" - J.R.R. Tolkien, The Two Towers'),(39,'book','\"Who, being loved, is poor?\" - Oscar Wilde, A Woman of No Importance'),(40,'ui','\"Every human life is worth the same, and worth saving.\" - J.K. Rowling, Harry Potter and the Deathly Hallows'),(41,'book','\"Travel far enough, you meet yourself.\" - David Mitchell, Cloud Atlas'),(42,'ui','\"None of us really changes over time. We only become more fully what we are.\" - Anne Rice, The Vampire Lestat'),(43,'book','\"Most people are nice when you finally see them.\" - Harper Lee, To Kill a Mockingbird'),(44,'book','\"Don’t panic.\" - Douglas Adams, The Hitchhiker’s Guide to the Galaxy'),(45,'ui','\"All endings are also beginnings. We just don’t know it at the time.\" - Mitch Albom, The Five People You Meet In Heaven'),(46,'ui','\"It’s no use going back to yesterday, because I was a different person then.\" - Lewis Carroll, Alice’s Adventures in Wonderland'),(47,'book','\"The only limits for tomorrow are the doubts we have today.\" - Pittacus Lore, The Power of Six'),(48,'ui','\"It is our choices that show what we truly are, far more than our abilities.\" - J.K. Rowling, Harry Potter and the Chamber of Secrets'),(49,'book','\"Fear doesn’t shut you down... it wakes you up.\" - Veronica Roth, Divergent'),(50,'ui','\"When you are imagining, you might as well imagine something worth while.\" - Lucy Maud Montgomery, Anne of Green Gables'),(51,'book','\"Not all those who wander are lost.\" - J.R.R. Tolkien, The Fellowship of the Ring'),(52,'book','\"It is sometimes an appropriate response to reality to go insane.\" - Philip K. Dick, Valis'),(53,'book','\"If you don’t imagine, nothing ever happens at all.\" - John Green, Paper Towns'),(54,'ui','\"So many things are possible just as long as you don’t know they’re impossible.\" - Norton Juster, The Phantom Tollbooth'),(55,'ui','\"Pain is inevitable. Suffering is optional.\" - Haruki Murakami, What I Talk About When I Talk About Running'),(56,'ui','\"You never know what worse luck your bad luck has saved you from.\" - Cormac McCarthy, No Country For Old Men'),(57,'ui','\"We must all face the choice between what is right and what is easy.\" - J.K. Rowling, Harry Potter and the Goblet of Fire'),(58,'ui','\"It’s only after we’ve lost everything that we’re free to do anything.\" - Chuck Palahniuk, Fight Club'),(59,'book','\"It is never too late to be wise.\" - Daniel Defoe, Robinson Crusoe'),(60,'book','\"Appear weak when you are strong, and strong when you are weak.\" - Sun Tzu, The Art of War'),(61,'book','\"Anything worth dying for is certainly worth living for.\" - Joseph Heller, Catch-22'),(62,'ui','\"All we have to decide is what to do with the time that is given to us.\" - J.R.R. Tolkien, The Fellowship of the Ring'),(63,'ui','\"If we encounter a man of rare intellect, we should ask him what books he reads.\" - Ralph Waldo Emerson'),(64,'ui','\"I would never read a book if it were possible for me to talk half an hour with the man who wrote it.\" - Woodrow Wilson'),(65,'book','\"Maybe ever’body in the whole damn world is scared of each other.\" - John Steinbeck'),(66,'book','\"It was a bright cold day in April, and the clocks were striking thirteen.\" - George Orwell, 1984'),(67,'ui','\"We were the people who were not in the papers. We lived in the blank white spaces at the edges of print. It gave us more freedom. We lived in the gaps between the stories.\" - Margaret Atwood, The Handmaid\\\'s Tale'),(68,'ui','\"It sounds plausible enough tonight, but wait until tomorrow. Wait for the common sense of the morning.\" - H. G. Wells, The Time Machine'),(69,'ui','\"It\\\'s much better to do good in a way that no one knows anything about it.\" - Leo Tolstoy, Anna Karenina'),(70,'ui','\"Finally, from so little sleeping and so much reading, his brain dried up and he went completely out of his mind.\" - Miguel de Cervantes Saavedra, Don Quixote'),(71,'ui','\"Memories warm you up from the inside, but they also tear you apart.\" - Haruki Murakami, Kafka on the Shore'),(72,'book','\"History, Stephen said, is a nightmare from which I am trying to awake.\" - James Joyce, Ulysses'),(73,'ui','\"It is a great misfortune to be alone, my friends, and it must be believed that solitude can quickly destroy reason.\" - Jules Verne, The Mysterious Island'),(74,'ui','\"No man, for any considerable period, can wear one face to himself and another to the multitude, without finally getting bewildered as to which may be the true.\" - Nathaniel Hawthorne, The Scarlet Letter'),(75,'ui','\"Nowadays people know the price of everything and the value of nothing.\" - Oscar Wilde, The Picture Of Dorian Gray'),(76,'book','\"No one forgets the truth, they just get better at lying.\" - Richard Yates, Revolutionary Road'),(77,'book','\"We need never be ashamed of our tears.\" - Charles Dickens, Great Expectations'),(78,'book','\"Nothing is so painful to the human mind as a great and sudden change.\" - Mary Shelley, Frankenstein'),(79,'ui','\"It doesn\\\'t matter who you are or what you look like, so long as somebody loves you.\" - Roald Dahl, The Witches'),(80,'ui','\"I know. I was there. I saw the great void in your soul, and you saw mine.\" - Sebastian Faulks, Birdsong'),(81,'ui','\"She says nothing at all, but simply stares upward into the dark sky and watches, with sad eyes, the slow dance of the infinite stars.\" - Neil Gaiman, Stars'),(82,'book','\"Anyone who ever gave you confidence, you owe them a lot.\" - Truman Capote, Breakfast at Tiffany\\\'s'),(83,'ui','\"Clocks slay time... time is dead as long as it is being clicked off by little wheels... only when the clock stops does time come to life.\" - William Faulkner, The Sound And The Fury'),(84,'ui','\"I know not all that may be coming, but be it what it will, I\\\'ll go to it laughing.\" - Herman Melville, Moby Dick'),(85,'ui','\"The more that you read, the more things you will know. The more that you learn, the more places you’ll go.\" - Dr. Seuss, I Can Read With My Eyes Shut!'),(86,'ui','\"I read my eyes out and can’t read half enough... The more one reads the more one sees we have to read.\" - John Adams'),(87,'ui','\"Sometimes I can feel my bones straining under the weight of all the lives I’m not living.\" - Jonathan Safran Foer, Extremely Loud and Incredibly Close'),(88,'book','\"What are men to rocks and mountains?\" - Jane Austen, Pride and Prejudice'),(89,'ui','\"A dream, all a dream, that ends in nothing, and leaves the sleeper where he lay down, but I wish you to know that you inspired it.\" - Charles Dickens, A Tale of Two Cities'),(90,'book','\"And now that you don’t have to be perfect, you can be good.\" - John Steinbeck, East of Eden'),(91,'ui','\"There are more things in Heaven and Earth, Horatio, than are dreamt of in your philosophy.\" - William Shakespeare, Hamlet'),(92,'ui','\"It might be that to surrender to happiness was to accept defeat, but it was a defeat better than many victories.\" - W. Somerset Maugham, Of Human Bondage'),(93,'ui','\"In spite of everything, I still believe people are really good at heart.\" - Anne Frank, The Diary of Anne Frank'),(94,'ui','\"She was becoming herself and daily casting aside that fictitious self which we assume like a garment with which to appear before the world.\" - Kate Chopin, The Awakening'),(95,'ui','\"We cross our bridges as we come to them and burn them behind us, with nothing to show for our progress except a memory of the smell of smoke, and the presumption that once our eyes watered.\" - Tom Stoppard, Rosencratz and Guildenstern Are Dead'),(96,'ui','\"There are darknesses in life and there are lights, and you are one of the lights, the light of all lights.\" - Bram Stroker, Dracula'),(97,'book','\"Everything was beautiful and nothing hurt.\" - Kurt Vonnegut, Slaughterhouse-Five'),(98,'book','\"My name is Inigo Montoya. You killed my father. Prepare to die.\" - The Princess Bride'),(99,'ui','\"It is a truth universally that a single man in possession of a good fortune must be in want of a wife.\" - Pride and Prejudice'),(100,'book','\"It was the best of times, it was the worst of times.\" - A Tale of Two Cities'),(101,'ui','\"Most men and women will grow up to love their servitude and will never dream of revolution.\" - Brave New World'),(102,'ui','\"Contradictions do not exist. Whenever you think that you are facing a contradiction, check your premises. You will find that one of them is wrong.\" - Atlas Shrugged'),(103,'book','\"Hey, boo.\" - To Kill a Mockingbird'),(104,'ui','\"Tomorrow I’ll think of some way to get him back. After all, tomorrow is another day.\" - Gone with the Wind'),(105,'book','\"All happy families are alike: each unhappy family is unhappy in its own way.\" - Anna Karenina'),(106,'book','\"Marley was dead as a doornail.\" - Charles Dickens, A Christmas Carol'),(107,'book','\"What fresh hell is this?\" - Jane Eyre');
/*!40000 ALTER TABLE `wp_wpbooklist_jre_book_quotes` ENABLE KEYS */;
UNLOCK TABLES;

